const App = () => (
    <div>
        <ul>
            <li><Link href='/'> <a> Home</a></Link></li>
            <li><Link href='/about'> <a> About</a></Link></li>
        </ul>
        <h1> Welcome to Bitzprice</h1>       
        <p> THis is the bitcoin price fetching learning by myself </p>
    </div>
)



export default App;
